import image01 from '../resources/symbol_1.png';
import image02 from '../resources/symbol_2.png';
import image03 from '../resources/symbol_3.png';
import image04 from '../resources/symbol_4.png';

let Images = [
    image01,
    image02,
    image03,
    image04
];

export default Images;
